INSERT INTO `inventario` VALUES (1,'Vara extensible','Pequeña porra de defensa personal extensible para contención puntual'),(2,'Bote de humo','Cilindro metálico de acero con algunas perforaciones en su parte superior e inferior, esto es para permitir la salida del humo cuando la granada ha sido activada. Contiene de 250 a 350 gramos de compuesto generador de humo (suele ser clorato de potasio) entintado'),(3,'Brújula Dyson','Dispositivo de orientación físico utilizable en el interior de las esferas de Ifkamhar'),(4,'Blaster de mano','Pistola de plasma ligera con dos modos: auturdimiento y perforante'),(5,'Cinto táctico','Mmm... Cinto táctico. Juer... Encima táctico'),(6,'HoloScooter','Moto diseñada para el desplazamiento por holopístas de ruta dinámica heurística'),(7,'Esposas magnéticas','Juego de esposas de bloqueo biométrico para retener muñecas y/o tobillos'),(8,'Rifle Phal','Rifle de plasma de largo alcance');
